// DeleteUniqueIndexCache 删除索引存在的缓存
func (s *SysDeptRepo) DeleteIndexCache(ctx context.Context, data ...*ai_boilerplate_model.SysDept) error {
	KeyMap := make(map[string]struct{})
	keys := make([]string, 0)
	keys = append(keys, s.cache.Key(CacheSysDeptByConditionPrefix))
	keys = append(keys, s.cache.Key(CacheSysDeptUnscopedByConditionPrefix))
	for _, item := range data {
		if item != nil {
			KeyMap[s.cache.Key(CacheSysDeptByIDPrefix, item.ID)] = struct{}{}
			KeyMap[s.cache.Key(CacheSysDeptUnscopedByIDPrefix, item.ID)] = struct{}{}
			KeyMap[s.cache.Key(CacheSysDeptByPidPrefix, item.Pid)] = struct{}{}
			KeyMap[s.cache.Key(CacheSysDeptUnscopedByPidPrefix, item.Pid)] = struct{}{}
		}
	}
	for item := range KeyMap {
		keys = append(keys, item)
	}
	err := s.cache.DelBatch(ctx, keys)
	if err != nil {
		return err
	}
	return nil
}
